select

from vw_customer_file cf
         left join
;
select distinct next.start_date
from ref_tariff_history_elec_ur prev
         inner join ref_tariff_history_elec_ur next
                    on prev.account_id = next.account_id and datediff(days, prev.end_date, next.start_date) = 1 and
                       prev.start_date != nvl(prev.end_date, '1990-05-23') and
                       next.start_date != nvl(next.end_date, '1990-05-23')



create table ref_tariffs
(
    id                 integer,
    fuel_type          varchar(1),
    gsp_ldz            varchar(2),
    name               varchar(20) default 'Igloo Pioneer'::character varying,
    billing_start_date timestamp,
    signup_start_date  timestamp,
    end_date           timestamp,
    standing_charge    double precision,
    unit_rate          double precision,
    discounts          varchar(50),
    tariff_type        varchar(20),
    exit_fees          double precision
);

alter table ref_tariffs
    owner to igloo;

-- tariff end dates
select distinct end_date
from ref_tariff_history_elec_ur
where account_id = 1831
order by start_date

select *
from ref_tariff_history_elec_ur
where account_id = 1831
order by start_date

-- dates everyone should be on the same tariff


select *
from ref_meterpoints_attributes
where account_id = 1831

select rate, attributes_attributevalue as gsp, name, min(start_date) as sd, max(end_date) as ed, count(*) as cnt
from ref_tariff_history_elec_ur eur
         inner join ref_meterpoints_attributes rma
                    on eur.account_id = rma.account_id and rma.attributes_attributename = 'GSP'
where gsp = '_J'
group by rate, gsp, name
having cnt > 25
order by gsp, sd, name

select *
from ref_tariff_history_elec_ur
where rate = 12.564

select *
from ref_tariff_history_elec_u

-- find tariffs given end dates
select attributes_attributevalue as gsp,
       case nvl(end_date, '2100-01-01')
           when '2017-07-23' then 1
           when '2018-05-15' then 2
           when '2018-08-31' then 3
           when '2018-10-24' then 4
           when '2019-03-12' then 5
           when '2019-05-01' then 6
           when '2019-06-09' then 7
           when '2100-01-01' then 8
           end                   as tariff_number,
       rate,
       count(*)                  as cnt
from ref_tariff_history_gas_sc eur
         inner join ref_meterpoints_attributes rma
                    on eur.account_id = rma.account_id and rma.attributes_attributename = 'GSP'
where tariff_number is not null
group by rate, gsp, tariff_number
--having cnt > 25
order by gsp, tariff_number, cnt desc

select distinct rate, attributes_attributevalue
from ref_tariff_history_elec_ur eur
         inner join ref_meterpoints_attributes rma
                    on eur.account_id = rma.account_id and rma.attributes_attributename = 'GSP'
where rma.attributes_attributevalue in ('_H', '_J')
  and end_date between '2017-07-25' and '2018-03-15'

-- find tariffs from start dates
select attributes_attributevalue as gsp,
       case
           when start_date between '2017-04-03' and '2017-07-23' then 1
           when start_date between '2017-07-24' and '2018-03-14' then 2
           when start_date between '2018-03-15' and '2018-07-23' then 3
           when start_date between '2018-07-24' and '2018-09-23' then 4
           when start_date between '2018-09-24' and '2019-03-04' then 5
           when start_date between '2019-03-05' and '2019-04-24' then 6
           when start_date between '2019-04-25' and '2019-06-01' then 7
           when start_date >= '2019-06-02' then 8
           end                   as tariff_number,
       rate,
       count(*)                  as cnt
from ref_tariff_history_gas_sc eur
         inner join ref_meterpoints_attributes rma
                    on eur.account_id = rma.account_id and rma.attributes_attributename = 'GSP'
where tariff_number is not null
group by rate, gsp, tariff_number
--having cnt > 25
order by gsp, tariff_number, cnt desc

select * from ref_tariff_history_gas_sc order by start_date

select chargeablecomponentuid, count(*) from aws_s3_stage2_extracts.stage2_tariffhistorygasstandcharge group by chargeablecomponentuid

